<div id="note_writings02">LEDシーリングライト LEDライト LED電球  LEDシーリング LED天井照明 ルームライト おしゃれシーリングライト リモコン付 壁スイッチOK 6畳用 ルミナス Luminous LED照明 LED照明器具 ルミナス ルミナスLED</div><style type="text/css">
/*カゴのボタンなど ＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝*/

/*買い物カゴボタン*/
input {
  font-weight:bold;
  letter-spacing:.1em;
  background:#990000;
  cursor:pointer;
  border-color:#cdcdcd;
  border-style:solid;
  border-width:1px 2px 2px 1px;
  color:#FFF;
  padding:20px;
}
/*IE対応*/
*html input {
  overflow:visible;
  background:#990000;
  color:#FFF;
}

input:hover {
  background-color:#cc0000;
}  

/*個数入力*/
input#units {
  border:solid #ccc 1px;
  background:#fff!important;
  cursor:auto;
  color:#000;  
}

/*お問い合わせボタン*/
font input {
  background:#fcfcfc;
  background-color:#f5f5f5;
  background-image:none;
  margin-bottom:5px;
  color:#000;  
}

 /*IE対応*/
*html font input {
  background:#fcfcfc no-repeat;
  background-color:#f5f5f5;
  color:#000;  
}   

font input:hover {
  background-color:#fff;
}  

/*カゴのボタンなど ＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝*/
